gin attempts, please try to use another browser\r\n and/or computer. The system was developed, in order to\r\n work optimally using the browser Firefox (free software),\r\n that may be downloaded freely from the internet.','This system utilizes \"Cookies\". You must have them\r\n activated in Your browser. If the system doesn\"t accept\r\n Your login attempts, please try to use another browser\r\n and/or computer. The system was developed, in order to\r\n work optimally using the browser Firefox (free software),\r\n that may be downloaded freely from the internet.',NULL,'Este sistema utiliza \"Cookies\" para funcionar.\r\n Por favor, os ativem no seu navegador (\"browser\"). \r\n Caso no consiga hacer \"login\", por favor, tente fazer a\r\n coneción com outro browser e/ou em outro computador.\r\n O sistema foi desenvolvido para funcionar optimalmente usando o\r\n Firefox (software livre), que pode ser instalado gratuitamente.','Este sistema utiliza \"Cookies\" para funcionar.\r\n Por favor, os ativem no seu navegador (\"browser\"). \r\n Caso no consiga hacer \"login\", por favor, tente hacer a\r\n conección com outro browser e/ou em outro computador.\r\n O sistema foi desenvolvido para funcionar optimalmente usando o\r\n Firefox (software livre), que pode ser instalado gratuitamente.',NULL,'0','0','0','0','0',1566411592,1566411592,1566411592,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(20,1624804990,1624804990,1648834582,'Application','Start','System/Actions.php','7',' 0','Início','Início',NULL,'Start','Start',NULL,'Início','Início',NULL,'1','0','0','1','1',1566411592,1566411592,1566411592,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(21,1624804991,1624804991,1625839149,NULL,'Register','System/LeftMenu.php','4',' 0','Registrar-se:','Registrar-se:',NULL,'Register:','Register:',NULL,'Registrar-se:','Registrar-se:',NULL,'1','0','0','0','0',1566411592,1566411592,1566411592,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(22,1624804991,1624804991,1625839149,NULL,'Personal','System/Lef